import React from 'react';

function Header() {
  return (
    <header>
      <h1>ID Lost and Found</h1>
      <nav>
        <a href="/">Home</a>
        <a href="/report">Report Lost ID</a>
      </nav>
    </header>
  );
}

export default Header;
